import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <nav className="navbar">
        <h1>Super Shop</h1>
        <div className="links">
          <Link to="/">Home</Link>
          <Link to="/signup">Log In</Link>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
